import { useEffect } from "react"
import { useDispatch } from "react-redux"
import styled from "styled-components"
import { triggerGetUser } from "../../../store/user"
import { ConnectedMainProps } from "../container/main"
import MainTabel from "./mainTabel"

const Main = ({ users }: ConnectedMainProps) => {
    const dispatch = useDispatch()

    useEffect(() => {
        dispatch(triggerGetUser())
    }, [])

    return (
        <HomeMain>
            <TabelContainer>
                <MainTabel users={users} />
            </TabelContainer>
        </HomeMain>
    )
}

const HomeMain = styled.div`
  width: 100%;
`;

const TabelContainer = styled.div`
background: #FFFFFF;
box-shadow: 0px 0px 10px #F4F4F4;
border-radius: 10px;
`;


export default Main
